import '../App.css';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';
import { Container, Row, Col } from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faVideo } from '@fortawesome/free-solid-svg-icons';
import { faHeart } from '@fortawesome/free-solid-svg-icons';
import { faStar } from '@fortawesome/free-solid-svg-icons';

function Movie(props) {

return (
<Row>
    <Col sm="12" lg="6" xl="4">
      <Card>
        <CardImg top width="100%" src="../img/badboy3.jpg" alt="Card image cap" />
        <CardBody>
          <CardText>Like<FontAwesomeIcon icon={faHeart} /></CardText>
          <CardText>Nombre de vues<FontAwesomeIcon icon={faVideo} /></CardText>
          <CardText>Mon avis<FontAwesomeIcon icon={faStar} /></CardText>
          <CardText>Moyenne<FontAwesomeIcon icon={faStar} /></CardText>
          <CardText>{props.nameMovie}</CardText>
          </CardBody>
      </Card>
      </Col>
      </Row>

);}


export {Movie};
